events.script:
#uses &quot;sdSymbolDynamics.ctl&quot;
const string DP = $dp;
const string NumberPost = $NumberPost;

main()
{
  const string DP = $dp;
const string NumberPost = $NumberPost;
  string PST = NumberPost;


  dpConnect(&quot;cbWorker&quot;, DP + &quot;.Post&quot; + NumberPost + &quot;.Sensor_Control.sStatusGroundBZA&quot;,               //1- состояние БЗА
                        DP + &quot;.Post&quot; + NumberPost + &quot;.Sensor_Control.sSensorFilter&quot;,                  //2- состояние фильтра
                        DP + &quot;.Post&quot; + NumberPost + &quot;.Sensor_Control.sGasHH&quot;,                         //3- Датчик загазованности
                        DP + &quot;.Post&quot; + NumberPost + &quot;.Sensor_Control.sFlowLL&quot;,                        //4- Датчик снижения расхода
                        DP + &quot;.Post&quot; + NumberPost + &quot;.Sensor_Control.sRiserTiltSensor&quot;,               //5- Датчик наклона стояка
                        DP + &quot;.Post&quot; + NumberPost + &quot;.Sensor_Control.sSensorGround&quot;,                  //6- Датчик заземления
                        DP + &quot;.Post&quot; + NumberPost + &quot;.Sensor_Control.sSensorOverflow&quot;,                //7- Датчик перелива
                        DP + &quot;.Post&quot; + NumberPost + &quot;.Sensor_Control.sSensorWorkPosition&quot;,            //8- Датчик рабочего положения наконечника
                        DP + &quot;.Post&quot; + NumberPost + &quot;.Sensor_Control.sGaragePosition&quot;,                //9- Датчик гаражного положения
                        DP + &quot;.Post&quot; + NumberPost + &quot;.Sensor_Control.sSensorTrapa&quot;,                   //10- Датчик трапа
                        DP + &quot;.Post&quot; + NumberPost + &quot;.Sensor_Control.sButtonStartStop&quot;,               //11- Кнопка пуск/стоп
                        DP + &quot;.Post&quot; + NumberPost + &quot;.Sensor_Control.sSensorAlarmStop&quot;,               //12- Датчик аварийного стопа 1
                        DP + &quot;.Post&quot; + NumberPost + &quot;.Sensor_Control.sSensorProduct&quot;                  //13- состояние наличия продукта
                        );
}

void cbWorker(dyn_string dp, dyn_anytype val){

  // Ground state
  switch(val[1]){
    case 0:
      StatusGroundBZA.text(&quot;Заземление не подключено&quot;);
      break;
    case 1:
      StatusGroundBZA.text(&quot;Заземление в гаражном положении&quot;);
      break;
    case 2:
      StatusGroundBZA.text(&quot;Заземление подключено&quot;);
      break;
    case 3:
      StatusGroundBZA.text(&quot;Тест геркона&quot;);
      break;
    case 4:
      StatusGroundBZA.text(&quot;Замыкание геркона&quot;);
      break;
    case 5:
      StatusGroundBZA.text(&quot;Обрыв геркона&quot;);
      break;
    case 6:
      StatusGroundBZA.text(&quot;Ошибка&quot;);
      break;
    default:
      StatusGroundBZA.text(&quot;Заземление неизвестно&quot;);
  }
  if(val[2] == 1)
    setValue(&quot;SensorFilter&quot;, &quot;backCol&quot;, &quot;Red&quot;);
  else
    setValue(&quot;SensorFilter&quot;, &quot;backCol&quot;, &quot;White&quot;);
  if(val[3] == 1)
    setValue(&quot;GasHH&quot;, &quot;backCol&quot;, &quot;Red&quot;);
  else
    setValue(&quot;GasHH&quot;, &quot;backCol&quot;, &quot;White&quot;);
  if(val[4] == 1)
    setValue(&quot;FlowLL&quot;, &quot;backCol&quot;, &quot;Red&quot;);
  else
    setValue(&quot;FlowLL&quot;, &quot;backCol&quot;, &quot;White&quot;);
  if(val[5] == 1)
    setValue(&quot;RiserTiltSensor&quot;, &quot;backCol&quot;, &quot;Red&quot;);
  else
    setValue(&quot;RiserTiltSensor&quot;, &quot;backCol&quot;, &quot;White&quot;);
  if(val[6] == 1)
    setValue(&quot;SensorGround&quot;, &quot;backCol&quot;, &quot;Red&quot;);
  else
    setValue(&quot;SensorGround&quot;, &quot;backCol&quot;, &quot;White&quot;);
  if(val[7] == 1)
    setValue(&quot;SensorOverflow&quot;, &quot;backCol&quot;, &quot;Red&quot;);
  else
    setValue(&quot;SensorOverflow&quot;, &quot;backCol&quot;, &quot;White&quot;);
  if(val[8] == 1)
    setValue(&quot;SensorWorkPosition&quot;, &quot;backCol&quot;, &quot;Red&quot;);
  else
    setValue(&quot;SensorWorkPosition&quot;, &quot;backCol&quot;, &quot;White&quot;);
  if(val[9] == 1)
    setValue(&quot;GaragePosition&quot;, &quot;backCol&quot;, &quot;Red&quot;);
  else
    setValue(&quot;GaragePosition&quot;, &quot;backCol&quot;, &quot;White&quot;);
  if(val[10] == 1)
    setValue(&quot;SensorTrapa&quot;, &quot;backCol&quot;, &quot;Red&quot;);
  else
    setValue(&quot;SensorTrapa&quot;, &quot;backCol&quot;, &quot;White&quot;);
  if(val[11] == 1)
    setValue(&quot;ButtonStartStop&quot;, &quot;backCol&quot;, &quot;Red&quot;);
  else
    setValue(&quot;ButtonStartStop&quot;, &quot;backCol&quot;, &quot;White&quot;);
  if(val[12] == 1)
    setValue(&quot;SensorAlarmStop&quot;, &quot;backCol&quot;, &quot;Red&quot;);
  else
    setValue(&quot;SensorAlarmStop&quot;, &quot;backCol&quot;, &quot;White&quot;);
  if(val[13] == 1)
    setValue(&quot;SensorProduct&quot;, &quot;backCol&quot;, &quot;Green&quot;);
  else
    setValue(&quot;SensorProduct&quot;, &quot;backCol&quot;, &quot;White&quot;);
}
